import React from "react";
import * as ReactBootStrap from "react-bootstrap"
import { render } from "react-dom";
import './Nav2.css';
import { useHistory } from "react-router";

function Nav(){
    const history = useHistory();
    const logout=()=>{
        history.push('/')
    }
    return(
        <>
        <ReactBootStrap.Navbar bg="dark" variant="dark">
            <ReactBootStrap.Container>
            <ReactBootStrap.Navbar.Brand href="#home" className="brand">Pay</ReactBootStrap.Navbar.Brand>
            <ReactBootStrap.Nav className="me-auto" >
            <ReactBootStrap.Nav.Link  className="child">Pay to an existing user</ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link href="#features" className="child">Send a reminder</ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link href="#pricing" className="child">Monthly expenditure</ReactBootStrap.Nav.Link>
            <ReactBootStrap.Nav.Link href="register" className="child">Notifications</ReactBootStrap.Nav.Link>
            </ReactBootStrap.Nav>
            <button className="btn" onClick={logout}>Log-out</button>
            </ReactBootStrap.Container>
        </ReactBootStrap.Navbar>
        </>
    );
}

export default Nav;
